INSERT INTO PUBLIC.EMPLOYEES(ID, LAST_NAME, FIRST_NAME, TITLE, TITLE_OF_COURTESY, SEX, BIRTH_DATE, HIRE_DATE, ADDRESS, CITY, REGION, POSTAL_CODE, COUNTRY, PHONE, EXTENSION, REPORTS_TO, NOTES, PHOTO_PATH) VALUES
(1, 'Davolio', 'Nancy', 'Sales Representative', 'Ms.', 1, DATE '1973-04-21', DATE '1992-05-01', '507 - 20th Ave. E. Apt. 2A', 'Seattle', 'WA', '98122', 'USA', '(206) 555-9857', '5467', 2, 'Education includes a BA in psychology from Colorado State University in 1970.  She also completed "The Art of the Cold Call."  Nancy is a member of Toastmasters International.', '2'),
(2, 'Fuller', 'Andrew', 'Vice President, Sales', 'Dr.', 1, DATE '1976-07-02', DATE '1992-08-14', '908 W. Capital Way', 'Tacoma', 'WA', '98401', 'USA', '(206) 555-9482', '3457', NULL, 'Andrew received his BTS commercial in 1974 and a Ph.D. in international marketing from the University of Dallas in 1981.  He is fluent in French and Italian and reads German.  He joined the company as a sales representative, was promoted to sales manager in January 1992 and to vice president of sales in March 1993.  Andrew is a member of the Sales Management Roundtable, the Seattle Chamber of Commerce, and the Pacific Rim Importers Association.', NULL),
(3, 'Leverling', 'Janet', 'Sales Representative', 'Ms.', 1, DATE '1988-01-11', DATE '1992-04-01', '722 Moss Bay Blvd.', 'Kirkland', 'WA', '98033', 'USA', '(206) 555-3412', '3355', 2, 'Janet has a BS degree in chemistry from Boston College (1984).  She has also completed a certificate program in food retailing management.  Janet was hired as a sales associate in 1991 and promoted to sales representative in February 1992.', '2'),
(4, 'Peacock', 'Margaret', 'Sales Representative', 'Mrs.', 0, DATE '1962-01-30', DATE '1993-05-03', '4110 Old Redmond Rd.', 'Redmond', 'WA', '98052', 'USA', '(206) 555-8122', '5176', 2, 'Margaret holds a BA in English literature from Concordia College (1958) and an MA from the American Institute of Culinary Arts (1966).  She was assigned to the London office temporarily from July through November 1992.', '2'),
(5, 'Buchanan', 'Steven', 'Sales Manager', 'Mr.', 1, DATE '1979-07-16', DATE '1993-10-17', '14 Garrett Hill', 'London', NULL, 'SW1 8JR', 'UK', '(71) 555-4848', '3453', 2, 'Steven Buchanan graduated from St. Andrews University, Scotland, with a BSC degree in 1976.  Upon joining the company as a sales representative in 1992, he spent 6 months in an orientation program at the Seattle office and then returned to his permanent post in London.  He was promoted to sales manager in March 1993.  Mr. Buchanan has completed the courses "Successful Telemarketing" and "International Sales Management."  He is fluent in French.', '2'),
(6, 'Suyama', 'Michael', 'Sales Representative', 'Mr.', 1, DATE '1987-11-13', DATE '1993-10-17', 'Coventry House Miner Rd.', 'London', NULL, 'EC2 7JR', 'UK', '(71) 555-7773', '428', 5, 'Michael is a graduate of Sussex University (MA, economics, 1983) and the University of California at Los Angeles (MBA, marketing, 1986).  He has also taken the courses "Multi-Cultural Selling" and "Time Management for the Sales Professional."  He is fluent in Japanese and can read and write French, Portuguese, and Spanish.', '5'),
(7, 'King', 'Robert', 'Sales Representative', 'Mr.', 1, DATE '1984-10-10', DATE '1994-01-02', 'Edgeham Hollow Winchester Way', 'London', NULL, 'RG1 9SP', 'UK', '(71) 555-5598', '465', 5, 'Robert King served in the Peace Corps and traveled extensively before completing his degree in English at the University of Michigan in 1992, the year he joined the company.  After completing a course entitled "Selling in Europe," he was transferred to the London office in March 1993.', '5'),
(8, 'Callahan', 'Laura', 'Inside Sales Coordinator', 'Ms.', 0, DATE '1982-05-23', DATE '1994-03-05', '4726 - 11th Ave. N.E.', 'Seattle', 'WA', '98105', 'USA', '(206) 555-1189', '2344', 2, 'Laura received a BA in psychology from the University of Washington.  She has also completed a course in business French.  She reads and writes French.', '2'),
(9, 'Dodsworth', 'Anne', 'Sales Representative', 'Ms.', 0, DATE '1990-06-10', DATE '1994-11-15', '7 Houndstooth Rd.', 'London', NULL, 'WG2 7LT', 'UK', '(71) 555-4444', '452', 5, 'Anne has a BA degree in English from St. Lawrence College.  She is fluent in French and German.', '5');
