b57\u9762\u4e0a\u5c31\u80fd\u5224\u65ad\u51fa\u6765\u6700\u591a\u53ea\u4f1a\u6709\u4e00\u4e2aEntity\u4f1a\u8fd4\u56de\u7684\uff0cqueryData\u5c31\u4e0d\u8fd4\u56de\u6570\u7ec4\u4e86\uff0c\u800c\u662f\u76f4\u63a5\u8fd4\u56de\u627e\u5230\u7684Entity\u3002')),
